import { useState, useEffect } from "react";
import { io } from "socket.io-client";
import {
  AppBar,
  Toolbar,
  Typography,
  Container,
  Grid,
  TextField,
  DragDropContext,
  Droppable,
  Draggable,
  Paper,
  Button,
  Divider,
} from "@mui/material";
import ReactMarkdown from "react-markdown";

function App() {
  const [agents, setAgents] = useState([
    {
      id: 1,
      name: "Gerente",
      role: "Gerente",
      goal: "Coordenar fluxo de trabalho",
      backstory: "Responsável por gerenciar o processo",
      tasks: ["Revisar relatório", "Aprovar orçamento"],
    },
    {
      id: 2,
      name: "Pesquisador",
      role: "Pesquisador",
      goal: "Coletar informações",
      backstory: "Especialista em pesquisa de dados",
      tasks: ["Coletar dados", "Analisar tendências"],
    },
    {
      id: 3,
      name: "Escritor",
      role: "Escritor",
      goal: "Criar conteúdo",
      backstory: "Redator especializado",
      tasks: ["Escrever artigo", "Revisar texto"],
    },
    {
      id: 4,
      name: "Programdador",
      role: "desenvolvedor fullstack",
      goal: "Programar e arquitetar projetos opensource com escalonamento",
      backstory: "Especialista em python, react, flutter, nodejs, docker e kubernetes",
      tasks: ["Desenvolver e arquitetar projetos opensource", "Implementar escalonamento"],
    },
  ]);
  const [agentOrder, setAgentOrder] = useState([]);
  const [socket, setSocket] = useState(null);
  const [loading, setLoading] = useState(false);
  const [isDragging, setIsDragging] = useState(false);
  const [prompt, setPrompt] = useState("");
  const [markdownResult, setMarkdownResult] = useState("");

  useEffect(() => {
    const newSocket = io('http://localhost:6000');

    newSocket.on('connect', () => {
      console.log('Connected to WebSocket server');
    });

    newSocket.on('connection_status', (data) => {
      console.log('Connection status:', data);
    });

    newSocket.on('task_results', (data) => {
      console.log('Received results:', data);
      setLoading(false);
      setMarkdownResult(data.markdown_result);
    });

    newSocket.on('disconnect', () => {
      console.log('Disconnected from WebSocket server');
    });

    setSocket(newSocket);

    return () => newSocket.disconnect();
  }, []);

  const handleDragStart = (e, agent) => {
    e.target.classList.add("agent-drag");
    setIsDragging(true);
    e.dataTransfer.setData("agent", JSON.stringify(agent));
  };

  const handleDrop = (e) => {
    e.preventDefault();
    setIsDragging(false);
    const droppedAgent = JSON.parse(e.dataTransfer.getData("agent"));

    // Only add if not already in the list
    if (!agentOrder.some(id => id === droppedAgent.id)) {
      setAgentOrder([...agentOrder, droppedAgent.id]);
    }
  };

  const removeAgent = (agentId) => {
    setAgentOrder(agentOrder.filter(id => id !== agentId));
  };

  const handleStartTasks = () => {
    if (!socket) {
      console.error('Socket not connected');
      return;
    }

    setLoading(true);
    console.log('Starting tasks with agents:', agentOrder);

    const selectedAgents = agentOrder.map(id => 
      agents.find(agent => agent.id === id)
    ).filter(agent => agent); // Remove any undefined agents

    if (selectedAgents.length === 0) {
      alert('Please select at least one agent first!');
      setLoading(false);
      return;
    }

    const data = {
      agents: selectedAgents,
      prompt: prompt
    };

    console.log('Sending data to server:', data);
    socket.emit('start_tasks', data);
  };

  return (
    <div className="flex h-screen bg-[#f5f5f5] overflow-hidden font-roboto">
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            Gerador de Agentes IA
          </Typography>
        </Toolbar>
      </AppBar>
      <Container style={{ marginTop: '20px' }}>
        <Grid container spacing={3}>
          <Grid item xs={12} md={3}>
            <Paper elevation={3} className="p-6">
              <Typography variant="h6" gutterBottom style={{ color: '#6a1b9a' }}>
                Agentes
              </Typography>
              <Divider style={{ marginBottom: '10px' }} />
              <div className="space-y-3">
                {agents.map((agent) => (
                  <div
                    key={agent.id}
                    draggable
                    onDragStart={(e) => handleDragStart(e, agent)}
                    onClick={() => setAgentOrder([...agentOrder, agent.id])}
                    className="p-4 bg-green-100 rounded-lg cursor-pointer hover:bg-green-200 transition-all transform hover:-translate-y-1 hover:shadow-md flex items-center gap-3"
                  >
                    <Typography variant="body1">{agent.name}</Typography>
                  </div>
                ))}
              </div>
            </Paper>
          </Grid>
          <Grid item xs={12} md={6}>
            <Paper elevation={3} className="p-6">
              <Typography variant="h6" gutterBottom style={{ color: '#6a1b9a' }}>
                Área de Processamento
              </Typography>
              <Divider style={{ marginBottom: '10px' }} />
              <div
                className={`bg-white p-6 rounded-lg shadow-lg mb-6 min-h-[200px] transition-colors ${isDragging ? "drop-zone-active" : ""}`}
                onDrop={handleDrop}
                onDragOver={(e) => {
                  e.preventDefault();
                  e.currentTarget.classList.add("drop-zone-active");
                }}
                onDragLeave={(e) => {
                  e.currentTarget.classList.remove("drop-zone-active");
                }}
              >
                <div className="flex flex-wrap gap-3">
                  {agentOrder.map((agentId, index) => (
                    <div
                      key={agentId}
                      className="flex flex-col items-center bg-green-100 px-4 py-2 rounded-lg shadow-sm hover:shadow transition-shadow"
                      style={{ width: '150px' }}
                    >
                      <Typography variant="body2">{`${index + 1}. ${agents.find(agent => agent.id === agentId).name}`}</Typography>
                      <Button
                        onClick={() => removeAgent(agentId)}
                        color="secondary"
                        size="small"
                        style={{ marginTop: '10px' }}
                      >
                        Remover
                      </Button>
                    </div>
                  ))}
                </div>
                <TextField
                  label={`Digite o prompt para a equipe ${agentOrder.map(agentId => agents.find(agent => agent.id === agentId).name).join(', ')}`}
                  value={prompt}
                  onChange={(e) => setPrompt(e.target.value)}
                  fullWidth
                  margin="normal"
                />
                {loading && <Typography variant="body2" color="primary" align="center" style={{ marginTop: '10px' }}>Carregando...</Typography>}
              </div>

              <Typography variant="h6" gutterBottom style={{ color: '#6a1b9a', marginTop: '20px' }}>
                Resultado
              </Typography>
              <Divider style={{ marginBottom: '10px' }} />
              <Paper elevation={2} className="p-4 markdown-content" style={{ minHeight: '200px', backgroundColor: '#f8f9fa' }}>
                <ReactMarkdown>
                  {markdownResult || "Markdown resultado a ser exibido aqui..."}
                </ReactMarkdown>
              </Paper>

            </Paper>
          </Grid>
          <Grid item xs={12} md={3}>
            <Paper elevation={3} className="p-6">
              <Typography variant="h6" gutterBottom style={{ color: '#6a1b9a' }}>
                Tarefas
              </Typography>
              <Divider style={{ marginBottom: '10px' }} />
              {agentOrder.map((agentId) => (
                <div key={agentId} className="p-4 bg-gray-50 rounded-lg mb-3">
                  <Typography variant="body1" gutterBottom>{agents.find(agent => agent.id === agentId).name}</Typography>
                  <ul>
                    {agents.find(agent => agent.id === agentId).tasks.map((task, index) => (
                      <li key={index}>{task}</li>
                    ))}
                  </ul>
                </div>
              ))}
              <Button
                variant="contained"
                color="primary"
                onClick={handleStartTasks}
                disabled={loading || agentOrder.length === 0}
                className={loading ? 'loading' : ''}
              >
                {loading ? 'Processing...' : 'Start Tasks'}
              </Button>
            </Paper>
          </Grid>
        </Grid>
      </Container>
      <style jsx global>{`
        .agent-drag {
          transform: scale(1.05);
          opacity: 0.8;
          transition: all 0.2s ease;
        }
        .drop-zone-active {
          background-color: #e8f4ff;
          border: 2px dashed #60a5fa;
        }
      `}</style>
    </div>
  );
}

export default App;
